DROP DATABASE PAYROLL;
CREATE DATABASE Payroll;
use payroll;
CREATE TABLE DEPARTMENT(
DEPARTMENT_ID INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
DEPARTMENT_NO INT NOT NULL,
DEPARTMENT_TITLE VARCHAR (255) NOT NULL
);
CREATE TABLE JOB (
JOB_ID INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
JOB_CLASS_PGRADE VARCHAR (10) NOT NULL,
JOB_TITLE VARCHAR (255) NOT NULL,
EMPLOYMENT_TYPE VARCHAR (10) NOT NULL,
JOB_STATUS VARCHAR (50) NOT NULL );
CREATE TABLE PAY (
PAY_ID INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
REGULAR_PAY INT NOT NULL,
OVERTIME_PAY INT NOT NULL,
ALL_OTHER_PAY INT NOT NULL,
TOTAL_PAY INT NOT NULL );
CREATE TABLE PENSION (
PENSION_ID INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
CITY_RETIREMENT_CONTRIBUTIONS INT NOT NULL,
BENEFIT_PAY INT NOT NULL);
CREATE TABLE EMPLOYEE(
EMPLOYEE_NO INT PRIMARY KEY NOT NULL,
GENDER VARCHAR (50) NOT NULL,
ETHNICITY VARCHAR (100) NOT NULL);










